import { Component } from 'react';
import { Link } from 'react-router-dom';

export default class Room extends Component {
    constructor(props){
        super(props);
        this.state = {code:props.code}
    }
    componentDidMount(){
        const requestOption = {
            method:'GET',
            headers:{'Content-Type':'application/json'}
        }
        fetch('http://localhost:8000/getRoom/' + this.state.code,requestOption)
            .then(res => res.json())
            .then(data => this.setState({rooms:data}))

    }
    render() {
        // const {code} = this.state.code;
        return (
            <section>
                <div className="card col" style={{ width: '18rem' ,margin:'35px'}}>
                    <img className="card-img-top" src ={process.env.PUBLIC_URL + '/images/dog.png'} style={{ width: '100%' }} alt="Card image cap" />
                    <div className="card-body">
                        <center>
                        <h5 className="card-title">{this.state.code}</h5>
                        <p className="card-text">{this.state.code}</p>

                        <Link to="/" className="btn btn-primary">Go to  {this.state.code}</Link>
                        </center>
                    </div>
                </div>


            </section>
        )
    }
}
